var itemsTable,orderVM=new Vue({el:"#app",data:{order:{isAddress2:!1,orderNo:orderNoParam}},methods:{loadData:function(){var n=this;axios.get("/api/admin/order/"+n.order.orderNo).then(function(t){var i=t.data;n.order=i;n.order.status=$.enumToName(OrderStatusEnum,n.order.status);n.order.createdOnUtc=$.timeFormat(n.order.createdOnUtc);n.order.isAddress2=!$.isNW(n.order.shipping_Address2)})}},beforeMount:function(){var n=this;n.loadData()}});itemsTable=$("#itemsTable").DataTable({responsive:!0,serverSide:!0,searchDelay:500,lengthMenu:[10,15,20],ajax:{url:"/api/admin/order/items",data:{orderNo:orderVM.order.orderNo}},columns:[{data:"sku"},{data:"asin"},{data:"alias",orderable:!1},{data:"color",orderable:!1},{data:"size",orderable:!1},{orderable:!1,render:function(n,t,i){if(!$.isNW(i.url))return`<a target="_blank" href="${i.url}">${i.url}</a>`}},{data:"qty",width:50,orderable:!1}],columnDefs:[{className:"text-center",targets:[-1]},],order:[[0,"DESC"]]});$(function(){$("#items-tab").on("shown.bs.tab",function(){$.isNW(itemsTable)&&createTable()})});